const initialState = {
  user: null,
  plateNumbers: [],
};

export const GUEST_REGIST_REQUEST = `GUEST_REGIST_REQUEST`;

const reducers = (state = initialState, action) => {
  switch (action.type) {
    case GUEST_REGIST_REQUEST: {
      let id = plateNumbers.length + 1;
      return {
        ...state,
        user: {
          id: 1,
          name: `김호연`,
          phone: `010-2739-0103`,
        },
        plateNumbers: [
          ...state.plateNumbers,
          { dueDate: action.data.dueDate, plateNumber: action.data.plateNumber },
        ],
      };
    }
    default: {
      return {
        ...state,
      };
    }
  }
};

export default reducers;
